let LSLGShaderSrcVertex = "#version 410 core\n\nlayout (location = 0) in vec3 position;\nlayout (location = 1) in vec3 normal;\nlayout (location = 2) in vec2 texcord;\n\nuniform mat4 model;\nuniform mat4 view;\nuniform mat4 projection;\nuniform float frame;\n\nout vec2 varTexcoord;\n\nvoid main()\n{\n    gl_Position = projection * view * model * vec4(position, 1.0);\n    varTexcoord = texcord;\n}"

let LSLGShaderSrcFragment = "#version 410 core\n\nin vec2 varTexcoord;\nout vec4 color;\n\nuniform float frame;\n\nvoid main() {\n  color = vec4(varTexcoord, sin(radians(mod(frame,360.0))), 1.0);\n}"

let LSLGShaderSrcNormalV = "// ================\n// Vertex shader:\n// ================\n#version 410 core\nlayout (location = 0) in vec3 position;\nlayout (location = 1) in vec3 normal;\n\nout VS_OUT {\n    vec3 normal;\n} vs_out;\n\nuniform mat4 projection;\nuniform mat4 view;\nuniform mat4 model;\n\nvoid main()\n{\n    gl_Position = projection * view * model * vec4(position, 1.0f); \n    mat3 normalMatrix = mat3(transpose(inverse(view * model)));\n    vs_out.normal = vec3(projection * vec4(normalMatrix * normal, 1.0));\n}"
let LSLGShaderSrcNormalF = "// ================\n// Fragment shader:\n// ================\n#version 410 core\nout vec4 color;\n\nvoid main()\n{\n    color = vec4(1.0f, 1.0f, 0.0f, 1.0f);\n}"
let LSLGShaderSrcNormalG = "// ================\n// Geometry shader:\n// ================\n#version 410 core\nlayout (triangles) in;\nlayout (line_strip, max_vertices = 6) out;\n\nin VS_OUT {\n    vec3 normal;\n} gs_in[];\n\nconst float MAGNITUDE = 0.2f;\n\nvoid GenerateLine(int index)\n{\n    gl_Position = gl_in[index].gl_Position;\n    EmitVertex();\n    gl_Position = gl_in[index].gl_Position + vec4(gs_in[index].normal, 0.0f) * MAGNITUDE;\n    EmitVertex();\n    EndPrimitive();\n}\n\nvoid main()\n{\n    GenerateLine(0); // First vertex normal\n    GenerateLine(1); // Second vertex normal\n    GenerateLine(2); // Third vertex normal\n}"